@historyinmemes Imagine loving and waiting for a person for 54 years when you don't even know if he's dead or alive.
Imagine the pain and suffering she went through. And how sad and tragic it is for her when she finally finds him and realises he has already moved on a long time
ago..

@historyinmemes "Goodbyes are only for those who love with their eyes. 

Because for those  who love with heart and soul there is no such thing as separation."

- Rumi
